// src/components/AdminDashboard/AdminDashboard.js
import { Routes, Route, Link } from 'react-router-dom';
import MealPlan from './MealPlan';
import AttendanceReport from './AttendanceReport';
import BillingHistory from './BillingHistory';
import FeedbackAnalysis from './FeedbackAnalysis';
import InventoryManagement from './InventoryManagement';
import ReportAnalytics from './ReportAnalytics';
import './admindashboard.css'; // Import CSS for styling (create this if it doesn't exist)

const AdminDashboard = () => {
  return (
    <div className="admin-dashboard">
      <h1>Admin Dashboard</h1>
      <p>Welcome to the Admin Dashboard! Use the links below to access each section:</p>

      <div className="admin-navigation">
        <Link to="/admin-dashboard/meal-plan">Meal Plan</Link>
        <Link to="/admin-dashboard/attendance-report">Attendance Report</Link>
        <Link to="/admin-dashboard/billing-history">Billing History</Link>
        <Link to="/admin-dashboard/feedback-analysis">Feedback Analysis</Link>
        <Link to="/admin-dashboard/inventory-management">Inventory Management</Link>
        <Link to="/admin-dashboard/report-analytics">Report Analytics</Link>
      </div>

      <div className="admin-content">
        <Routes>
          <Route path="/meal-plan" element={<MealPlan />} />
          <Route path="/attendance-report" element={<AttendanceReport />} />
          <Route path="/billing-history" element={<BillingHistory />} />
          <Route path="/feedback-analysis" element={<FeedbackAnalysis />} />
          <Route path="/inventory-management" element={<InventoryManagement />} />
          <Route path="/report-analytics" element={<ReportAnalytics />} />
        </Routes>
      </div>
    </div>
  );
};

export default AdminDashboard;
